import React from 'react';
import { Link } from "react-router-dom";
import './main.css';

function Projects() {

  const adoculosData = {
    "title": "Lowering the barrier",
    "description": "Princeton senior thesis"
  }
  return (
    <div className="">

      <Link to={"/projects/adoculos"} params={adoculosData}>
        AdOculos
      </Link>

    </div>
  );
}

export default Projects;
